线性表
线性表中的数据以线性结构排列，每个结点都有其前驱结点和后驱结点（头节点没有前驱结点，尾结点没有后驱结点）。结点之间只有前后驱的关系（相隔很远的结点，比如ABCD中的A和D，可以看作A是D的间接前驱）。
线性表根据数据在内容中的排列方式的不同，分为顺序表和链表。
1.1顺序表
顺序表中的数据在内存中是连续存储的，其最大的好处在于，寻址数据简单，时间复杂度是O(1)，最大的缺点在于需要一片连续的地址空间，对内存的要求较高。
需要注意的是，顺序表和数组是不同的，线性表是可以扩展和伸张的，而数组的长度一定是固定的。在Go语言里头，可以理解为顺序表就是切片slice。顺序表和数组的区别大致就是slice和数组的区别。（Java中ArrayList的实现，个人更倾向于是链表（Linked List），因为其查找数据的时间复杂度是O(n)）
快速使用（以slice代替定义）：
1.1.1 顺序表的定义
type slice struct {
    array unsafe.Pointer    // 一个指向底层数组的指针
    len   int                // slice的长度
    cap   int                // slice的容量
}

1.1.2 顺序表的插入
由于顺序表中的元素之间的前后驱关系是固定的，在某个特定位置（假设该位置上有元素）插入元素时，需要将该位置及其后面的元素进行移动，空出该位置，然后再插入元素，因此，其插入元素的时间复杂度为O(n)。
在Go语言中，内置了函数append用于对slice进行尾插操作：
// The append built-in function appends elements to the end of a slice. If
// it has sufficient capacity, the destination is resliced to accommodate the
// new elements. If it does not, a new underlying array will be allocated.
// Append returns the updated slice. It is therefore necessary to store the
// result of append, often in the variable holding the slice itself:
//    slice = append(slice, elem1, elem2)
//    slice = append(slice, anotherSlice...)
// As a special case, it is legal to append a string to a byte slice, like this:
//    slice = append([]byte("hello "), "world"...)
func append(slice []Type, elems ...Type) []Type

在此实现一个中间插入函数供读者学习：
package main

import (
    "fmt"
)

// 实现slice的中间插入方法
func SliceInsert(x int,index int, arrays []int) []int{
    /**
    最开始时构想是想做一个通用性接口，发现go1.17不支持泛型.....
     */
    //首先对x和arrays的类型进行断言，如果不是同一类型，则报错
    //xtype := reflect.TypeOf(x).Kind()
    //arrrstype := reflect.TypeOf(arrays).Elem().Kind()
    //if arrrstype != xtype{
    //    panic(fmt.Sprintf("%T data can not insert in %T slice!!",xtype,arrrstype))
    //}

    // 必须进行一次深拷贝，直接引用会引用arrays的底层数组
    // temp := arrays[index:]
    // 当执行arrays = append(arrays[:index], x)时，temp里的值也会改变
    temp := make([]int,0)
    temp = append(temp, arrays[index:]...)
    arrays = append(arrays[:index], x)
    arrays = append(arrays, temp...)
    return arrays
}

func main(){
    var testslice = []int{1,2,3,5,6}
    testslice = SliceInsert(4,3, testslice)
    fmt.Println(testslice)

}

1.1.3 顺序表的元素删除
删除操作可以用append来实现，即，将index前的元素和index后的元素拼接起来即可
// 使用append来实现删除slice指定位置的元素
package main

import "fmt"

func Remove(slice []int, i int) []int {
    //通过slice来实现，相当于再{1,2}后面追加{4,5,6,7}
    slice = append(slice[:i], slice[i+1:]...)    
    // 为了避免一些内存分配等错误最好是先接到返回值，再返回slice，不要直接返回
    return slice
}

func main()  {
    x := []int{1,2,3,4,5,6,7}
    x = Remove(x,2)
    fmt.Println(x)
}

1.2 链表
链表中的数据在内存中是独立存储的（即不必开辟一片连续的空间），这样其能节省内存中的空间，合理的运用内存中的碎片空间，提高内存的利用率，但所带来的麻烦就是其寻址数据的时间复杂度是O(n)。
同时有其第二个好处：因为其元素节点之间的前后驱关系并不是强关系，即可以通过指针重新赋予前驱和后驱，因此其插入的时间复杂度为O(1)。
1.2.1 单链表定义
因此，对于单链表而言，需要先定义一个Node结点类，这一点和C语言的数据结构是相似的
// Node class
type Node struct {
    property int
    nextNode *Node
}

由Node组成的单链表的定义如下：（此处定义的是不带头结点的单链表）
type LinkedList struct {
    //head unsafe.Pointer    //带头结点的链表
    headNode *Node
}

定义了一个LinkedList的打印输出函数
func (linkList *LinkedList) printList() {
    ok := linkList.headNode
    fmt.Print("[")
    for ok != nil {
        property := ok.property
        fmt.Print(property)
        if ok.next != nil {
            fmt.Print(",")
        }
        ok = ok.next
    }
    fmt.Print("]\n")
}

1.2.2 单链表的插入（分为头插入和尾插入）
头插入顾名思义，是在链表的头部插入结点，结点的顺序和插入的顺序是相反的（即第一个插入的结点在最后，最后一个插入的结点时第一个结点）。
// AddToHead 单链表头插入
func (linkedlist *LinkedList) AddToHead(property int) {
    node := Node{}
    node.property = property
    node.next = linkedlist.headNode
    linkedlist.headNode = &node
}

尾插入顾名思义，是在链表的末尾追加结点，类似于append。
在定义尾插入之前，先定义一个获得最后一个结点的方法：
// LastNode 获取链表的最后一个结点
func (l *LinkedList) LastNode() *Node {
    var lastNode *Node
    for node := l.headNode; node != nil; node = node.next {
        if node.next == nil {
            lastNode = node
        }
    }
    return lastNode
}

尾插入定义如下：
// AddToEnd 单链表尾插入
func (linkedlist *LinkedList) AddToEnd(property int) {
    node := Node{}
    node.property = property
    node.next = nil
    ok := linkedlist.LastNode()
    ok.next = &node
}

1.2.3 按值查找
由于Go支持多返回值，因此我们可以通过值来查找结点在链表中的位置，并返回结点及其序号。
func (l *LinkedList) FindWithValue(property int) (findNode *Node , index int) {
    index =0
    for node := l.headNode; node!=nil; node=node.next{
        index++
        if node.property == property {
            findNode = node
            break;
        }
    }
    return findNode,index
}

1.2.4 指定位置插入
在指定的位置插入，插入的时间复杂度是O(index)，index指的是插入的下标
在这个过程中，必须要注意的是断开指针链的顺序，必须先将待插入结点tempnode的next赋值为node的后驱,,即tempnode.next=node.next，再将node的next链接到tempnode上。以免覆盖。
// AddAfter 在指定位置后插入结点
func (linkedList *LinkedList) AddAfter(property int, index int) {
    tmpindex := 0
    tmpnode := Node{property,nil}
    for node := linkedList.headNode; node !=nil;node = node.next{
        tmpindex++
        if tmpindex == index {
            tmpnode.next = node.next
            node.next=&tmpnode
            break
        }
    }
}

类似的，还有在指定位置前插入结点，在指定值的前后插入结点，其代码结构大同小异，在此就不在过多的赘述。
1.3 双链表
双链表和单链表的不同在于双链表的每个结点都有指向其前驱和后驱的指针。在Go语言的container/list包已经是实现了双链表的定义以及一些基本操作。
1.3.1 双链表的定义
双链表结点的定义：
type Element struct {
    // Next and previous pointers in the doubly-linked list of elements.
    // To simplify the implementation, internally a list l is implemented
    // as a ring, such that &l.root is both the next element of the last
    // list element (l.Back()) and the previous element of the first list
    // element (l.Front()).
    next, prev *Element

    // The list to which this element belongs.
    list *List
    // 由后面的方法可以看出，list并没有实际意义，更多的是为了做一些检查

    // The value stored with this element.
    Value interface{}
}

以及对双链表的定义：
// List represents a doubly linked list.
// The zero value for List is an empty list ready to use.
type List struct {
    root Element // sentinel list element, only &root, root.prev, and root.next are used
    len  int     // current list length excluding (this) sentinel element
}

针对于结点，还定义了其寻找前驱和后驱的方法：
// Next returns the next list element or nil.
func (e *Element) Next() *Element {
    if p := e.next; e.list != nil && p != &e.list.root {
        return p
    }
    return nil
}

// Prev returns the previous list element or nil.
func (e *Element) Prev() *Element {
    if p := e.prev; e.list != nil && p != &e.list.root {
        return p
    }
    return nil
}

1.3.2 双链表的查找
Go语言内置实现了双链表的查找方法，分别为返回链表的第一个值func (l *List) Front()和返回链表的最后一个值func (l *List) Back()，源代码如下：
// Front returns the first element of list l or nil if the list is empty.
func (l *List) Front() *Element {
    if l.len == 0 {
        return nil
    }
    return l.root.next
}

// Back returns the last element of list l or nil if the list is empty.
func (l *List) Back() *Element {
    if l.len == 0 {
        return nil
    }
    return l.root.prev
}

可能有些读者看着会有些疑惑，为什么Back()里用根结点的前驱即可返回最后一个结点？根节点不是没有前驱吗？其原因在于前面定义的注释之中，原文为：To simplify the implementation, internally a list l is implemented as a ring，就是说，设计者为了简化实现，将双链表做成了一个环，头结点的前驱结点链接到了尾结点，尾结点的后驱连接到了头结点。因此Back函数仅用l.root.prev即返回了最后一个结点
1.3.3 双链表的插入
Go设计插入时，将插入的逻辑抽象出来形成了一个单独的方法insert，这个方法是隐含字段。同样还有以值插入的隐含方法insertValue，源代码如下：
// insert inserts e after at, increments l.len, and returns e.
// 在结点at后面插入e，链表长度增加，并返回e结点
func (l *List) insert(e, at *Element) *Element {
    e.prev = at            
    e.next = at.next
    e.prev.next = e
    e.next.prev = e
    e.list = l
    l.len++
    return e
}

// insertValue is a convenience wrapper for insert(&Element{Value: v}, at).
// 如果仅给值v，那么就先初始化一个结点e，然后插入at之后
func (l *List) insertValue(v interface{}, at *Element) *Element {
    return l.insert(&Element{Value: v}, at)
}

基于这两个基本方法，Go实现了头插入方法PushFront()，尾插入方法 PushBack()，在指定的结点前插入值InsertBefore()，以及在指定的结点后插入值InsertAfter()，源代码如下：
// PushFront inserts a new element e with value v at the front of list l and returns e.
func (l *List) PushFront(v interface{}) *Element {
    l.lazyInit()
    return l.insertValue(v, &l.root)
}

// PushBack inserts a new element e with value v at the back of list l and returns e.
func (l *List) PushBack(v interface{}) *Element {
    l.lazyInit()
    return l.insertValue(v, l.root.prev)
}

// InsertBefore inserts a new element e with value v immediately before mark and returns e.
// If mark is not an element of l, the list is not modified.
// The mark must not be nil.
func (l *List) InsertBefore(v interface{}, mark *Element) *Element {
    if mark.list != l {
        // 这里做了一个检查，要求mark必须是l中的结点，否则，就不会修改并返回nil
        return nil
    }
    // see comment in List.Remove about initialization of l
    // 在Remove的comment如下：
    // if e.list == l, l must have been initialized when e was inserted
    // 就是说，如果mark.list == l，那么其mark一定已经初始化过了
    return l.insertValue(v, mark.prev)
}

lazyInit()方法是Go实现的使用时初始化机制，避免了用户在使用时前仅定义而没有初始化产生错误的情况。源代码如下：
func (l *List) lazyInit() {
    if l.root.next == nil {
        l.Init()
    }
}
